import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
      </header>
      <body>
        <div className='app_signup'>
          <input type="text" placeholder='Enter Email'/>
          <input type="text" placeholder='Enter Password' />
        </div>
      </body>

    </div>
  );
}

export default App;
